import React, { useEffect, useState } from "react";
import { numericLiteral } from "@babel/types";
const App = () => {
  useEffect(() => {
    const h3js = document.querySelector("#javascript");
    console.log(h3js.dataset.lang);
  });

  return (
    <>
      <h3 data-lang="js" id="javascript">
        javascript
      </h3>
      <h3 data-lang="py" id="python">
        javascript
      </h3>
      <h3 data-lang="ph" id="php">
        javascript
      </h3>
    </>
  );
};

export default App;
